package com.shuiyu.test.myapplication.Bean;import java.io.Serializable;import java.util.List;public class Data implements Serializable{	private static final long serialVersionUID = 1435148338L;	private List<BootList> bootList;	private List<String> joinRoomMsg;	private long close_vote;	private Update update;	private String host;	private List<String> bootImg;	public List<BootList> getBootList() {		return this.bootList;	}	public void setBootList(List<BootList> bootList) {		this.bootList = bootList;	}	public List<String> getJoinRoomMsg() {		return this.joinRoomMsg;	}	public void setJoinRoomMsg(List<String> joinRoomMsg) {		this.joinRoomMsg = joinRoomMsg;	}	public long getClose_vote() {		return this.close_vote;	}	public void setClose_vote(long close_vote) {		this.close_vote = close_vote;	}	public Update getUpdate() {		return this.update;	}	public void setUpdate(Update update) {		this.update = update;	}	public String getHost() {		return this.host;	}	public void setHost(String host) {		this.host = host;	}	public List<String> getBootImg() {		return this.bootImg;	}	public void setBootImg(List<String> bootImg) {		this.bootImg = bootImg;	}	public Data() {}	public Data(List<BootList> bootList, List<String> joinRoomMsg, long close_vote, Update update, String host, List<String> bootImg){		super();		this.bootList = bootList;		this.joinRoomMsg = joinRoomMsg;		this.close_vote = close_vote;		this.update = update;		this.host = host;		this.bootImg = bootImg;	}	public String toString() {		return "Data [bootList = " + bootList + ", joinRoomMsg = " + joinRoomMsg + ", close_vote = " + close_vote + ", update = " + update + ", host = " + host + ", bootImg = " + bootImg + "]";	}}